import style from "../pages/index.scss";
import Layout from "../components/Layout";
import "./index.scss";

function HomePage() {
  return (
    <Layout>
      <div className={style.div}>Welcome to Next.js!</div>
    </Layout>
  );
}

export default HomePage;
